import React from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.css";
import debtComp from "./components/debt";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h3>Budgetizer 1.0</h3>
        <div className="container">
          <div className="row">
            <div className="col-sm">
              <debtComp />
            </div>
            <div className="col-sm">Bills</div>
            <div className="col-sm">Calendar</div>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
